/* eslint react/no-multi-comp: 0, react/prop-types: 0 */

import React, { useState } from 'react';
import { Button, Modal, ModalHeader, ModalBody, ModalFooter, Form, FormGroup, Label, Input, FormText} from 'reactstrap';

const ActualizarVeci = (props) => {
  const {
    buttonLabel,
    className
  } = props;

  const [datos, setDatos] = useState({
    id_veci: '',
    direccion: '',
    numero: '',
    nom_numero: '',
    numero0: '',
    nom_numero0: '',
  });

  const [modal, setModal] = useState(false);

  const toggle = () => setModal(!modal);

  return (
    <div>
      <Button color="success" onClick={toggle}>Actualizar</Button>
      <Modal isOpen={modal} toggle={toggle} className={className}>
        <ModalHeader toggle={toggle}>Modal title</ModalHeader>
        <ModalBody>
            <Form>
                <FormGroup>
                <Label for="exampleEmail">ID</Label>
                <Input type="text" name="id" placeholder="ID" />
                </FormGroup>
                <FormGroup>
                <Label for="exampleEmail">Direccion</Label>
                <Input type="text" name="direccion" placeholder="" />
                </FormGroup>
                <FormGroup>
                <Label for="exampleEmail">Nombre del Contacto</Label>
                <Input type="text" name="nom_numero" placeholder="ID" />
                </FormGroup>
                <FormGroup>
                <Label for="exampleEmail">Número Telefónico del Contacto</Label>
                <Input type="text" name="numero" placeholder="ID" />
                </FormGroup>
                <FormGroup>
                <Label for="exampleEmail">Nombre del Contacto 2</Label>
                <Input type="text" name="nom_numero0" placeholder="ID" />
                </FormGroup>
                <FormGroup>
                <Label for="exampleEmail">Número Telefónico del Contacto 2</Label>
                <Input type="text" name="numero0" placeholder="ID" />
                </FormGroup>
            </Form>
        </ModalBody>
        <ModalFooter>
          <Button color="primary" onClick={toggle} >Do Something</Button>{' '}
          <Button color="secondary" onClick={toggle}>Cancel</Button>
        </ModalFooter>
      </Modal>
    </div>
  );
}

export default ActualizarVeci;
